    /**
     * Selects a collection of Cheque objects pre-filled with their Banco objects.
     * @param      Criteria  $criteria
     * @param      PropelPDO $con
     * @param      String    $join_behavior the type of joins to use, defaults to Criteria::LEFT_JOIN
     * @return array           Array of Cheque objects.
     * @throws PropelException Any exceptions caught during processing will be
     *		 rethrown wrapped into a PropelException.
     */
    public static function doSelectJoinBanco(Criteria $criteria, $con = null, $join_behavior = Criteria::LEFT_JOIN)
    {
        $criteria = clone $criteria;

        // Set the correct dbName if it has not been overridden
        if ($criteria->getDbName() == Propel::getDefaultDB()) {
            $criteria->setDbName(ChequePeer::DATABASE_NAME);
        }

        ChequePeer::addSelectColumns($criteria);
        $startcol = ChequePeer::NUM_HYDRATE_COLUMNS;
        BancoPeer::addSelectColumns($criteria);

        $criteria->addJoin(ChequePeer::BANCO_ID, BancoPeer::ID, $join_behavior);

        // symfony_behaviors behavior
        foreach (sfMixer::getCallables(self::getMixerPreSelectHook(__FUNCTION__)) as $sf_hook)
        {
          call_user_func($sf_hook, 'BaseChequePeer', $criteria, $con);
        }

        $stmt = BasePeer::doSelect($criteria, $con);
        $results = array();

        while ($row = $stmt->fetch(PDO::FETCH_NUM)) {
            $key1 = ChequePeer::getPrimaryKeyHashFromRow($row, 0);
            if (null !== ($obj1 = ChequePeer::getInstanceFromPool($key1))) {
                // We no longer rehydrate the object, since this can cause data loss.
                // See http://www.propelorm.org/ticket/509
                // $obj1->hydrate($row, 0, true); // rehydrate
            } else {

                $cls = ChequePeer::getOMClass();

                $obj1 = new $cls();
                $obj1->hydrate($row);
                ChequePeer::addInstanceToPool($obj1, $key1);
            } // if $obj1 already loaded

            $key2 = BancoPeer::getPrimaryKeyHashFromRow($row, $startcol);
            if ($key2 !== null) {
                $obj2 = BancoPeer::getInstanceFromPool($key2);
                if (!$obj2) {

                    $cls = BancoPeer::getOMClass();

                    $obj2 = new $cls();
                    $obj2->hydrate($row, $startcol);
                    BancoPeer::addInstanceToPool($obj2, $key2);
                } // if obj2 already loaded

                // Add the $obj1 (Cheque) to $obj2 (Banco)
                $obj2->addCheque($obj1);

            } // if joined row was not null

            $results[] = $obj1;
        }
        $stmt->closeCursor();

        return $results;
    }


